        return new Source("{% extends 'base.html.twig' %}

{% block title %}Nous contacter{% endblock %}

{% block body %}





<div class=\"container d-flex justify-content-center mt-5\">
    <div class=\"col-lg-5 col-md-8\">
        <h3 class=\"h4\">Nous contacter</h3>    
        <form class=\"form\"  method=\"post\">
            {{ form_start(form) }}
            {% if app.user %}
            {{ form_row(form.fieldName, {'attr' : { 'placeholder' :'Nom' , 'value' : app.user.firstname ~ ' ' ~ app.user.lastname }}) }} 
            {{ form_row(form.email, {'attr' : { 'placeholder' :'Email' , 'value' : app.user.email }}) }} 
            {% else %}
            {{ form_row(form.fieldName, {'attr' : { 'placeholder' :'Nom'  }}) }}
            {{ form_row(form.email, {'attr' : { 'placeholder' :'Email'}}) }} 
            {% endif %}
            {{ form_row(form.about, {'attr' : { 'placeholder' :'Sujet' }}) }} 
            {{ form_row(form.content, {'attr' : { 'placeholder' :'Votre message ici' }}) }}
            <div class=\"d-flex justify-content-center\">                
                <button type=\"submit\" class=\"col-md-12 btn btn-outline-success mt-3\">Envoyer!</button>
            </div>
            {{ form_end(form) }}  
        </form>
    </div>
   
</div>
</div>

    
{{ include('partials/footer.html.twig') }}
{% endblock %}", "home/contact.html.twig", "/var/www/html/PROJET/projet-PartageVehicules/wiwatt/templates/home/contact.html.twig");
